// http
export const HTTP_STATUS_CODE = {
    OK: 200,
    BadRequest: 400,
    Unauthorized: 401,
    Forbidden: 403,
    NotFound: 404,
    InternalServerError: 500,
};
export const NETWORK_ERROR = 'Network Error. Try again later.';

// auth
export const AUTH_TOKEN = 'authToken';
export const TOKEN_EXPIRY = 'tokenExpiry';
